public class GodListActivity extends AppCompatActivity {

    private SwipeMenuListView listView;
    private CustomArrayAdapter adapter;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_god_list);
        Toolbar toolbar = (Toolbar) findViewById(R.id.toolbar);
        setSupportActionBar(toolbar);

        listView = (SwipeMenuListView)findViewById(R.id.listView);

        SwipeMenuCreator creator = new SwipeMenuCreator() {
            @Override
            public void create(SwipeMenu menu) {
                // create "open" item
                SwipeMenuItem openItem = new SwipeMenuItem(
                        getApplicationContext());
                // set item background
                openItem.setBackground(new ColorDrawable(Color.rgb(0xC9, 0xC9, 0xCE)));
                // set item title
                openItem.setTitle("Open");
                // set item title fontsize
                openItem.setTitleSize(18);
                // set item title font color
                openItem.setTitleColor(Color.WHITE);
                // add to menu
                menu.addMenuItem(openItem);
            }
        };

        // set creator
        listView.setMenuCreator(creator);

        listView.setOnMenuItemClickListener(new SwipeMenuListView.OnMenuItemClickListener() {
            @Override
            public boolean onMenuItemClick(int position, SwipeMenu menu, int index){

                GodDetailActivity activity = new GodDetailActivity();
                Intent intent = new Intent(GodListActivity.this, GodDetailActivity.class);
                activity.startActivity(intent);

                // false : close the menu; true : not close the menu
                return false;
            }
        });

        popularLista();
    }

    public void popularLista() {
        //CursorList<Item> cursor = Query.many(Item.class, "select * from item where id_compra = ? order by id", idCompra).get();
        List<God> godList = new ArrayList<God>();

        God godExample = new God();
        godExample.setId(0L);
        godExample.setName("Another God");
        godExample.setReligion("Religion of Arts");
        godExample.setOrigin("Soul");
        godExample.setSummary("Religião das Arte mano, é nóis");
        godExample.setImage("");
        godList.add(godExample);

        //getSupportActionBar().setTitle("PDV " + Util.getFormatedCurrency(String.valueOf(valorTotal)));
        adapter = new CustomArrayAdapter(this, R.layout.list_item, godList);
        listView.setAdapter(adapter);
    }
}